Discovering: Sting

Arts Documentary hosted by Cal Saville, published by BSkyB in 2014 - English narration


Information
------------------------------

Discovering: Sting
Documentary examining the defining moments in the musician's career.
After coming to the world's attention as the charismatic leader of arena-filling power trio The Police, the man born Gordon Sumner went on to enjoy a hugely successful and varied solo career. The programme examines the internal bickering that led to his dramatic exit from the band following a sell-out performance at Shea Stadium, and the bold new identity he forged on his debut solo album The Dream of the Blue Turtles. It also explores the impact of his collaboration with rap superstar Nas, and the sampled use of his classic Every Breath You Take on Puff Daddy's hit tribute to the late Biggie Smalls.

